const About = () => {
  return (
    <div>
        Welcome to [Your Shop Name] - Your Ultimate Destination for Fashion!

At [Your Shop Name], we believe that fashion is more than just clothing; it's a statement, an expression of individuality, and a reflection of personal style. Established with a passion for providing the latest trends and timeless classics, we strive to be your go-to online destination for men, women, and kids' clothing.
    </div>
  )
}

export default About
